"""
    coriolis(q, qp)

Calculate the Coriolis term, C(q, qp)qp, of Kinova Gen3 robot for a given configuration.

# Arguments
- `q::SVector{7, Float64}`: the joint angles of the robot [rad]
- `qp::SVector{7, Float64}`: the joint velocities of the robot [rad/s]

# Examples
```julia-repl
julia> coriolis!(zeros(SVector{7}), zeros(SVector{7}), zeros(SVector{7}))
coming soon...
```
"""
function coriolis(q::SVector{7, Float64}, qp::SVector{7, Float64})
    C = zeros(MVector{7})

    coriolis!(q, qp, C)

    return C
end
